import React from 'react';
import PropTypes from 'prop-types';

const App = () => {
  const profile = [
    {name: "Taro", age: 20},
    {name: "Batako", age: 19},
    {name: "NoAge"}
  ]
  return (
    <div>
      {
        profile.map((profile, index) => {
          return <User name={profile.name} age={profile.age} key={index} />
        })
      }
    </div>
  )
}

const User = (props) => {
  return (
    <div>
      hi! i'm {props.name}. {props.age} old.
    </div>
  )
}

//初期値の設定
